import Vue from 'vue';
import Vuetify from 'vuetify/lib/framework';

Vue.use(Vuetify);

export default new Vuetify({
    theme: {
        options: {
            customProperties: true,
        },
        themes: {
            dark: {
                primary: '#127475',
                secondary: '#ABFF4F',
                error: '#F2542D',
                info: '#0E9594',
                success: '#29BF12',
                warning: '#FF9914',
                col1: '#F4F3EE',
                col2: '#BCB8B1',
                col3: '#F4F3EE',
                col4: '#BCB8B1',
                col5: '#F4F3EE',
                col6: '#BCB8B1'
            },
            light: {
                primary: '#127475',
                secondary: '#ABFF4F',
                error: '#F2542D',
                info: '#0E9594',
                success: '#29BF12',
                warning: '#FF9914',
                background: '#562C2C',
                background1: '#F5DFBB',
            },
        },
    },
});
